function setHeights(obj) {
  var arr = [],
      i = 0;

  $(obj).each(function() {
    i++;
    arr.push($(this).height());

    if ( i == obj.length - 1 ) {
      $(obj).height(Math.max.apply(null, arr)).css('opacity', 1);
    }
  });
}


